import React, { Component } from 'react'
import { withRouter } from 'react-router-dom'
import { AppBar, Toolbar, Typography, Button } from "@mui/material"
import WalletConnector from './WalletConnector'

class NavBar extends Component {
  render() {
    const GotoExchange = withRouter(({ history }) => (
      <Button
        onClick={() => { history.push('/exchange') }}
      >
        <Typography color="white" variant="h7">Exchange</Typography>
      </Button>
    ))
    const GotoHome = withRouter(({ history }) => (
      <Button
        onClick={() => { history.push('/') }}
      >
        <Typography color="white" variant="h7">Home</Typography>
      </Button>
    ))

    return (
      <div sx={{display: "flex"}}>
        <AppBar
        position="fixed"
        sx={{width: "100%"}}
        color="primary"
        >
          <Toolbar>
            <Typography variant="h6">Deez Token Trader</Typography>
            <div style={{ marginLeft: "30px" }}>
              <GotoHome />
              <GotoExchange />
            </div>
            <WalletConnector handleConnect={this.props.handleConnect}/>
          </Toolbar>
        </AppBar>
      </div>
    )
  }
}

export default NavBar
